package com.cjbdi

import org.apache.kafka.clients.producer.{KafkaProducer, ProducerRecord}
import org.apache.kafka.common.serialization.StringSerializer

import java.io.File
import java.util.Properties

/**
 * @Author RookieX
 * @Date 2021/12/3 10:17 上午
 * @Description: 直接将数据发送打 kafka 指定 topic
 */
object ProducerDemo {
  def main(args: Array[String]): Unit = {
    // 1 配置参数
    val props = new Properties()
    // 连接kafka节点
    props.setProperty("bootstrap.servers", "rookiex01:9092,rookiex02:9092,rookiex03:9092")
    //指定key序列化方式
    props.setProperty("key.serializer", "org.apache.kafka.common.serialization.StringSerializer")
    //指定value序列化方式
    props.setProperty("value.serializer", classOf[StringSerializer].getName) // 两种写法都行

    //ack通知：0， 1， -1
    //0 只要把数据发送过去，不管leader是否确认，就发送完成（发送速度最快，但是最不安全）
    //1 将数据发送个leader分区分区写入log文件，leader分确认，就是发送成功
    //-1/all 将数据发送给leader分区写入log文件，每一个follower分区也都要将log文件后然后进行要应达，才算发送成功（对数据安全性比较高的）
    //props.setProperty("acks", "1") //ack应答
    //props.setProperty("retries", "100") //重试次数，默认是无限重启
    //props.setProperty("compression.type", "gzip") //压缩方式，可以使用四种压缩方式'gzip', 'snappy', 'lz4', 'zstd'
    //props.setProperty("max.request.size",  1048576 * 2 + "") //发送数据的大小
    //props.setProperty("request.timeout.ms", "60000") //超时时间

    val topic = "xx2" //三个分区{0, 1, 2}

    // 2 kafka的生产者
    val producer: KafkaProducer[String, String] = new KafkaProducer[String, String](props)
    // 3 封装的对象
//    val mes = "{\"base64File\":\"\",\"wsBean\":{\"database\":\"fb_00\",\"fbId\":\"15\",\"host\":\"192.8.21.224\",\"schema\":\"db_msys\",\"t_c_baah\":\"（2006）浦民二（商）初字第1000号\",\"t_c_jbfymc\":\"XX法院\",\"t_d_sarq\":\"2020-01-01 00:00:00\",\"t_n_jbfy\":\"12345\",\"ws_c_nr\":\"/aaa/vvv/ccc/ddd/qer.html\",\"ws_n_lb\":\"2988\"}}"
    val mes = "{\"base64File\":\"\",\"wsBean\":{\"database\":\"\",\"fbId\":\"\",\"host\":\"\",\"schema\":\"\",\"t_c_baah\":\"\",\"t_c_jbfymc\":\"\",\"t_c_stm\":\"0f3015decce982a64005961397e8191815f5\",\"t_d_sarq\":\"\",\"t_n_jbfy\":\"\",\"ws_c_mc\":\"当事人地址确认书\",\"ws_c_nr\":\"/3250/3267/0302/384/326720180302005632/10.html\"}}"
//    val mes = "{\"base64File\":\"\",\"wsBean\":{\"database\":\"fb_00\",\"fbId\":\"15\",\"host\":\"192.8.21.224\",\"schema\":\"db_msys\",\"t_c_baah\":\"（2006）浦民二（商）初字第1000号\",\"t_c_jbfymc\":\"XX法院\",\"t_d_sarq\":\"2020-01-01 00:00:00\",\"t_n_jbfy\":\"12345\",\"ws_c_nr\":\"/aaa/vvv/ccc/ddd/qer.html\",\"ws_n_lb\":\"2988\"}}"
//        val mes = "{\"base64File\":\"\",\"wsBean\":{\"database\":\"fb15_10\",\"fbId\":\"15\",\"host\":\"192.1.48.224\",\"schema\":\"db_xses\",\"t_c_baah\":\"（2021）沪01刑终92号\",\"t_c_jbfymc\":\"上海市第一中级人民法院\",\"t_c_stm\":\"044db83cbbf48d15175ce055000000000001\",\"t_d_sarq\":\"2021-01-06 00:00:00\",\"t_n_jbfy\":\"1101\",\"ws_c_mc\":\"刑事裁定书\",\"ws_c_nr\":\"/1100/1101/0202/383/110120210202000767/044dba107369f10f0ad8e055000000000001-1.html\",\"ws_n_lb\":\"5\"}}"
    val record = new ProducerRecord[String, String](topic, mes)
    producer.send(record) //将将数据发送到Kafka（是一条一条的发送吗？，还是先在客户端缓存，达到一定的大小在批量发送）

    producer.flush()

    println("message send success")

    //producer.flush()
    // 释放资源
    producer.close()
  }
}
